import { useState } from 'react';
import '../styles.css';
import { Card, Typography } from '@mui/material';
import { PieCharts } from '@mui/x-charts';
import Dashboard from './Dashboard';
import Projects from './Projects';
import { Paper, Box } from '@mui/material';

export default function Matter() {

    return (
        <div
        style={{
            height: "100vh",
            width: "90%",
            margin: "auto",
            textAlign:"center",
            backgroundColor: "white",
            color: "black"
        }}
    >


       <Card
        className='card'
       >
        <div    
            style={{
                padding:"10px",

            }}
            >
            <Typography variant='h4'>About me.</Typography>
            <Typography variant='body'>Im a Software Engineer.</Typography>
        </div>
       </Card>
       <Card
            sx={{
                height: "30%"
            }}
       >
       <Typography 
            variant='h4'
            sx={{
                textAlign: 'left'
            }}
            >Highlights</Typography>
       <Box className="highlights-body"
            sx={{
                display: 'flex',
                flexWrap: 'wrap',

            }}>

            <Paper elevation={3}
                className='highlight'
            >
                <Typography>Highlight 1</Typography>
            </Paper>
            <Paper elevation={3}
                className='highlight'
            >
            <Typography>Highlight 2</Typography>
            </Paper>
            <Paper elevation={3}
                className='highlight'
            >
            <Typography>Highlight 3</Typography>
            </Paper>
        </Box>

       </Card>

       <Paper
             className='card'
             elevation={3}
       >
        <Typography variant='h4'>Career Pulse</Typography>
        <Typography variant='body'> The dashboard below highlights my skills and Roles I have held over the past 5 odd years.</Typography>
        <Dashboard></Dashboard>
       </Paper>
       <Card
        className='card'
       >
        <Projects />
       </Card>

    </div>
    )
}
